function on_press(){
    var size = document.getElementById("sel_size")
    var country = document.getElementById("sel_country")
    var inst = document.getElementById("sel_inst")  
    var field = document.getElementById("sel_field") 
    var rank = document.getElementById("sel_rank") 

//use sel_chart and sel_size as ids...
var fnname = country.value.trim() + "_" + inst.value.trim() + "_" + size.value.trim() + "_" + field.value.trim() + "_" + rank.value.trim() + "()"
console.log(fnname)
//found how to try, catch, alert from https://stackoverflow.com/questions/4923316/eval-javascript-check-for-syntax-error
try{
    fld_fnname = "fld_" + fnname 
    rnk_fnname = "rnk_" + fnname
    ins_fnname = "ins_" + fnname
    gen_fnname = "gen_" + fnname
    eval(fld_fnname)
    eval(gen_fnname)
    eval(ins_fnname)
    eval(rnk_fnname)


} catch (e) {
    alert("The values you selected do not make sense or do not have sufficient data")
}

}
